window.bookSummaryJSON = "<p>With my life going down in literal flames I ran from everything: From my father, from a forced marriage, from my mates.</p> <p>Now, charged with a crime I didn’t commit, they’re all hunting me. And they’re <i>all</i> furious.</p> <p>The dangerous deputy headmaster of Animus Academy manages to catch me and along with three of my five mates (two are still a mystery) we’re taken back to the prison-school they use to teach feral beasts how to live alongside humans.</p> <p>Now I’m locked up with the very men I’ve been trying to avoid all my life.</p> <p>No one can know who my mates are. No one can know who I really am. Because if they do, it’s lights out for me. I’ll be chained and bred until I die.</p> <p>And I refuse to allow that to happen.</p> <p><b>This is the first book in a New Adult MFMMMM 5 book series where the heroine has five fated mate love interests that will form a bonded group. It is slow burn with 18+ spice starting from book 1. Each book has a cliffhanger ending but the series will finish with a HEA.</b></p> <p><b>Length: 13 hours</b></p> <p><b>Tropes: fated mates, found family, hidden identity, hidden powers, slow-mid burn</b></p> <p><b>Please see author's website for content warnings: ektaabali.com/themes</b></p>"; 
